import React from 'react'

function Social() {
    return (
        <div>
            <ul className='list-group'>
                <li className='list-group-item'>Facebook</li>
                <li className='list-group-item'>Youtube</li>
                <li className='list-group-item'>Instagram</li>
            </ul>
        </div>
    );
}
export default Social
